export class GameModel
{
    name: string;
    genre: string;
    price: number;
    GameReleaseDate: string;

    constructor(name:string,genre:string,price:number,releaseDate:string){
      this.GameName = name;
      this.GameGenre = genre;
      this.GamePrice = price;
      this.GameReleaseDate = releaseDate;
    }

    toJSON(){
      return{
        GameName: this.GameName,
        GameGenre: this.GameGenre,
        GamePrice: this.GamePrice,
        GameReleaseDate: this.GameReleaseDate,
      }
    }
}
